import styled from "styled-components";
import React from 'react'

const Header = (props) => {
    return (
        <Container>
            <Content>
                Header
            </Content>
        </Container>
    );
};

const Container = styled.div`
    background-color: white;
    border-bottom: 1px solid rgba(0, 0, 0, 0.08);
    left: 0;
    padding: 0 35px;
    position: fixed;
    top: 0;
    width: 100vw;
    z-index: 100;

`
const Content = styled.div`

`

export default Header
